import React from "react";

function About() {
  return (
    <div>
      <h2>About Us</h2>
      <p>
        JewelStore has been crafting elegant jewellery since 1990.
        We believe in quality, trust, and timeless designs that
        bring joy to our customers.
      </p>
    </div>
  );
}

export default About;
